INSERT INTO `game` (`gameID`, `gameName`, `releaseDate`, `gameDescription`) VALUES
(1, 'Poštar Marko', '2020-06-13 15:31:52', 'Poštar Marko mora dostaviti svu poštu do kraja dana. Pomozi Marku dostaviti sva pisma i sve pakete na njihova odredišta!'),
(2, 'Color Wheel', '2020-06-13 15:31:52', 'In the world where all the color was sucked out by the Void monsters, you must pass all of the levels and collect as much color as you can and defeat the Void monsters. Help our main character and return the color to the world.'),
(3, 'Super Mario Redo', '2020-06-14 12:14:36', 'A redo of our favorite childhood game. This is a work in progress where we for fun want to make our favorites with our own little twists.'),
(4, 'FPS Kamino', '2020-06-14 12:14:36', 'First person shooter from the point of view of a clone commander on the planet of Kamino. Complete all of the exercises and become and ARC Trooper!'),
(5, 'RUN!', '2020-06-14 12:27:18', 'RUN! is an infinte runner in which you must escape from the horrible monsters following you down the dark city streets. All the while you must be careful what\'s in front of you too. This little horror project is planned to be launched somewhere around Halloween, so be prepared and stay spooky!'),
(6, 'Round Trip', '2020-06-14 12:27:18', 'Join our main character and travel around the world by solving interesting mind puzzles and riddles! The farther you travel the harder they become but there\'s always a reward at the end of each journey. Collect all of the souveniers and win rewards.'),
(7, 'Irena kuha ', '2023-06-06 22:00:00', 'Prijevod H. Rachama iz 1914.\r\n\"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain.\"'),
(8, 'Mikela piše css', '2020-06-16 22:00:00', 'Ne znam. '),
(9, 'Ovo je zadnja nova igra', '2020-06-16 22:00:00', 'Proba 50.');

