(1, 'Prvi \'Poštar Marko\' post', 'What is Lorem Ipsum?\r\n\r\nLorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'news', '2020-06-13 15:42:23', 1111, 1),
(2, 'Introducing Poštar Marko', 'Poštar Marko je igra koja je nastala u suradnji sa Hrvatskom Poštom kako bi se građani bolje upoznali sa radom poštara.', 'devlog', '2020-06-13 15:42:23', 1111, 1),
(3, 'Introducing Color Wheel', 'Color Wheel igra je osmišljena za završni rad na fakultetu. To je platformer u kojem kako prolazimo levele sakupljamo boje, te s tim bojama bojimo svijet u kojem se nalazimo. Na prvom levelu je sve sivo, odnosno bezbojno, no kako prolazimo levele to je svijet u kojem se nalazi naš glavni lik sve šareniji.', 'devlog', '2020-06-13 15:44:30', 1111, 2),
