(24, 'Neki pokusaj', 'Homicide is the killing of one person by another. Murder is a form of criminal homicide, where the perpetrator intended to kill the other person, sometimes with premeditation (a plan to kill). Manslaughter is another type of criminal homicide. Homicides are criminal, excusable, or justifiable.', 'news', '2020-06-15 22:00:00', 1111, 6),
(26, 'Naslov posta', 'PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.PHP is a server scripting language, and a powerful tool for making dynamic and interactive Web pages.', 'devlog', '2020-06-15 22:00:00', 1111, 5),
(29, 'Post post', 'Odlomak 1.10.32 iz djela \"de Finibus Bonorum et Malorum\", napisao Ciceron 45.g.pr.n.e\r\n\"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\"\r\n\r\n', 'devlog', '2020-06-15 22:00:00', 1111, 6),
(30, 'Lorem Ipsum ', 'Prijevod H. Rachama iz 1914.\r\n\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\"', 'news', '2020-06-15 22:00:00', 1111, 6),
(44, '#1 devlog', 'Morbi luctus sodales velit a vulputate. Cras id scelerisque ante. Sed sagittis ultricies turpis sit amet mollis. Etiam et elementum sem, eu pharetra mauris. Morbi accumsan ultricies tellus, at rutrum augue porta quis. ', 'devlog', '2020-06-16 20:17:31', 1111, 7),
(45, '#2 devlog', 'Morbi luctus sodales velit a vulputate. Cras id scelerisque ante. ', 'devlog', '2020-06-16 20:18:13', 1111, 7),
(46, 'Obavijest ', 'Neradni dani i državni praznici 2020. u Hrvatskoj', 'news', '2020-06-16 20:19:00', 1111, 2),
